INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_aboutHeader`, `field_aboutBody`, `field_ourBoothTopHeader`, `field_ourBoothTopBody`, `field_ourBoothMiddleBody`, `field_header`, `field_textBody`, `field_ourBoothBottomHeader`, `field_ourBoothBottomBody`, `field_packageHeader`, `field_packageBody`, `field_metaDescription`, `field_metaTitle`, `field_facebook`, `field_twitter`, `field_instagram`, `field_pinterest`, `field_ourBoothMiddleHeader`, `field_classes`, `field_contactHeader`, `field_contactBody`, `field_contactBackgroundColor`, `field_packageBackgroundColor`, `field_ourBoothTopBackgroundColor`, `field_firstName`, `field_lastName`, `field_phoneNumber`, `field_email`, `field_eventDate`, `field_eventStartTime`, `field_eventEndTime`, `field_eventType`, `field_fullName`, `field_message`, `field_eventName`, `field_eventLocation`, `field_howDidYouFindUs`, `field_experiencePackage`, `field_galleryHeadingLeft`, `field_galleryHeadingRight`, `field_gallerisTitle`, `field_galleryLinkLeft`, `field_galleryLinkRight`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-12 21:58:15', '2016-06-12 21:58:15', '8598df09-6a6c-42e9-a71e-9a7f143fb4bd'),
 ('2', '2', 'en_us', 'Home', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', 'Welcome to The LAB', '<p>The LAB is a Dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events. Our luxurious open-air photo booth is sure to make a statement and make memories that you’ll never forget.</p>\n\n<p>So, what’s your occasion? A birthday? A wedding? A corporate shindig? You name it and The LAB photo booth will take the fun and entertainment up a notch. </p>', 'A Close up of the LAB', '<p>What sets The LAB apart is our ability to seamlessly become part of the party and provide a fun, yet stylish experience. You get a professional quality camera and lighting equipment that promises to never take a bad picture and totally WOW your guests. The LAB provides:</p>', '<p>Inside The LAB is where all the magic happens and pictures truly come alive. Our collection of backdrops and props lets your guests make their photo op as classic or quirky as they’d like. Let’s get started!<br /></p>', NULL, NULL, 'The Lab Propshop', '<p>It’s important that every picture is one of a kind and 100% YOU. The LAB’s PropShop is fully loaded with tons of different accessories, masks and other knick-knacks necessary to make each picture anything but ordinary. Having an 80’s party and need a rockin’ mullet wig? We can cater the PropShop to match any party theme.</p>', 'The LAB Experience Packages', '<p>There are tons of different party and event ideas that The LAB can add hours of fun and excitement to. From personal to corporate level, The LAB has options to fit your needs.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'Come on in The LAB', NULL, 'Contact', '<p>Yes! We\'re excited that you want more info on The LAB. Please compete the information below and we’ll get in touch soon to get the party started!</p>', '#000000', '#bfbc31', '#ffffff', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-12 21:58:16', '2016-10-25 14:32:55', 'c8df68d8-7f50-477b-8196-448a3cc9fe2d'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Localhost. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-12 21:58:16', '2016-06-12 21:58:16', 'bc7c339b-e4b8-4397-9a26-01ce711de3ce'),
 ('4', '4', 'en_us', 'Open-air Design', '<p>The LAB has an elegant, modern open-air design making it easy to set up in any type of venue. There are no constraints and no extra clutter. Whether you’re a posing solo or with a group, there is ample space for up to 20 guests to get an effortlessly perfect shot</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:50:41', '2016-06-14 03:50:41', '8f98bbf9-ab84-4ae0-8e5d-c32d59898e03'),
 ('5', '5', 'en_us', 'Studio Quality Camera', '<p>It wouldn’t be fair to get dolled up just to get a bad picture in return. The LAB is equipped with innovative photographic technology and professional lighting that ensure highest quality images every time.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:51:08', '2016-06-14 03:51:08', '608e41b4-45c3-4488-8e62-2e009dbdfbc8'),
 ('6', '6', 'en_us', 'Snap & Share', '<p>We know once you get that killer shot, you’re going to want everyone to see it. Share and send your picture directly to your social media pages or via email or text instantly with our convenient and super easy touchscreen technology. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:51:50', '2016-06-14 03:51:50', '25c6d1b4-985c-4977-8318-e44336a4cfe8'),
 ('7', '7', 'en_us', 'The Perfect Keepsake', '<p>Every photo is customizable to commemorate the occasion. Choose from an assortment of photo sizes customized with frames, company logos, event graphics and more. The possibilities are endless to transform your pictures into an ultimate celebration souvenir.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:52:08', '2016-06-14 03:52:08', '8dac105d-cf81-442e-9785-530bd2de8f0b'),
 ('8', '8', 'en_us', 'Empty   ', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'text-white', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:55:13', '2016-09-18 17:55:13', '5a4d2e15-c25d-42ed-8291-edfd9b5f2c7f'),
 ('9', '9', 'en_us', 'We\'ve got your back(drop)', '<p>The backdrop is the canvas on which the perfect pictures are created. Our assortment of backgrounds come in an array of different colors and patterns to compliment the excitement of your celebration. Do you need a backdrop of a ship for a bon voyage party or other party themes? Let us know what you would like and we’ll make it happen!</p>\n\n<p>Scroll to the left or right to view some of our favorites. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'text-black', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:55:34', '2016-09-23 06:30:38', '2bf452f5-9522-4dcb-b785-d5548d29303c'),
 ('10', '10', 'en_us', 'The UPTOWN', '<p>No time for prints? The social both allows you to instantly send your picture to yourself via text/email or share with your friends posting your picture directly to your social media page right from the booth! </p>\n\n<ul><li>2 hours of LAB time</li><li>1 LAB assistant</li><li>Personalized photo design</li><li>Online Facebook gallery</li><li>Social media integration </li></ul><p>$550</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:57:20', '2016-09-12 01:14:16', '83651aa1-c54d-4b77-828a-2604dfbfae92'),
 ('11', '11', 'en_us', 'The GROVE', '<p>Two full hours with the booth, a beautiful backdrop and a LAB assistant to help you through. Your guests are sure to be entertained and they will be leaving with a personalized keepsake from your event.</p>\n\n<ul><li>2 hours of LAB time</li><li>1 LAB assistant</li><li>Standard backdrop</li><li>Personalized photo design</li><li>Unlimited 1 print per setting</li></ul><p>$700<br /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:58:26', '2017-04-27 13:52:38', '82895417-2ece-412d-9fe9-3523d6747a54'),
 ('12', '12', 'en_us', 'The KESSLER', '<p>This has been the option for many happy clients – in addition to your backdrop selection, additional print per sitting, your guest will enjoy digging into the PropShop to truly customize their shot. For three hours The LAB is yours to capture all your event memories!</p>\n\n<ul><li>3 hours of LAB time</li><li>2 LAB assistants</li><li>Standard backdrop </li><li>Standard PropShop</li><li>Personalized photo design</li><li>Unlimited 2 prints per setting</li><li>Online Facebook gallery</li><li>Social media integration</li></ul><p>$900<br /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 03:59:53', '2016-09-12 01:13:25', 'bc056a5a-a522-4135-bd82-016f6a86d61c'),
 ('13', '13', 'en_us', 'The CLIFF', '<p>Keep your guest coming back for more with four full hours with The LAB, two LAB assistants, a premium backdrop and custom props from the PropShop.  Plus, your guest will have the option to print the keepsake and use the social kiosk to share a copy friends on their Facebook or Twitter page. <br /></p>\n\n<ul><li>4 hours of LAB time </li><li>2 LAB assistants </li><li>Premium backdrop  </li><li>Custom PropShop</li><li>Personalized photo design </li><li>Unlimited </li><li>Online Facebook gallery </li><li>Social media integration </li><li>Social media kiosk </li></ul><p>$1350</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 04:00:57', '2016-09-12 01:12:25', 'b2eed1b2-c46c-4715-ba61-01d22525116c'),
 ('14', '14', 'en_us', 'HEADSHOTS', '<p>Are your employees using selfies and Instagram-filtered pictures for their professional headshots? The LAB is now available for headshots. You’ll get six headshots each for up to 35 employees – with additional employees for $25 a person. We provide you with a white backdrop, a LAB assistant, and digital copies of every image. You provide the professionalism – or goofiness! After all it’s your headshot</p><p>$800</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-14 04:01:31', '2016-06-14 04:01:31', '72418d53-9aff-43c3-b636-2b6624413676'),
 ('15', '15', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-30 03:58:22', '2016-06-30 03:59:58', 'ef4d249a-4f61-4539-ae3e-0cd1c08ce390'),
 ('16', '16', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/eventsbythelab', ' https://twitter.com/labphotobooth', 'https://www.instagram.com/labphotobooth/', 'https://www.pinterest.com/labphotobooth/', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-07-03 18:06:22', '2016-09-09 19:37:23', '7edfb81f-f4f9-41ad-8e0a-8567d243cfec'),
 ('17', '17', 'en_us', 'Backgrounds', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-05 03:35:41', '2016-08-26 15:56:48', 'b6f7a3f3-1f6f-46e2-948b-d4fbc9597063'),
