 ('22', '22', 'en_us', 'Icons Logo Veritcal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-31 01:20:49', '2016-08-31 01:20:49', '4757da63-671f-4018-b004-7ed45b8c9999'),
 ('23', '23', 'en_us', 'Long Pattern', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-31 01:22:41', '2016-08-31 01:22:41', 'ec87d0ae-7b15-4ee0-85da-4ee3ff8ad388'),
 ('24', '24', 'en_us', 'FAQ', '<p>We’ve taken some of the most asked questions about The LAB and listed them here. <a href=\"/#contact\">Give us a shout</a> if we missed anything!</p>', NULL, NULL, NULL, NULL, NULL, 'Frequently Asked Questions', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-02 19:42:16', '2016-09-14 16:39:16', '014136ce-e563-4c8a-be5e-30908e107103'),
 ('25', '25', 'en_us', 'How does the booth actually work? ', '<p>We’re so glad you asked! When you’re ready to take a pic, just step up to the booth to get started. \n\n  </p>\n\n<p>Feel free to sort through our plethora of props and let the good times roll. You’ll be able to see yourself live on our screen and it’s as easy as pose, snap, repeat.</p>\n\n<p> After you’re done, pick up your printed keepsake and share on social media.</p>\n\n<p> That’s it! Pretty simple. Remember, there will be a LAB assistant available to help you every snap of the way!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-02 19:44:55', '2016-09-12 06:30:14', '19ede972-7759-487d-9e8f-fac47be9b906'),
 ('26', '26', 'en_us', 'What does open-air mean? ', '<p>Open-air means that the days of cramming into a photo booth are over! \n\n  </p>\n\n<p>There are no constraints and no extra clutter. The LAB gives you ample space to shine in a solo picture or pack in the fun with a group picture of 20 (or more) guests to get an effortlessly perfect shot.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-02 19:45:47', '2016-09-12 06:28:46', '81f38760-d3aa-49cc-8bca-88a139f40386'),
 ('27', '31', 'en_us', 'How do I make sure The LAB is a hit with my guest? ', '<p>Three words.\n\n  </p>\n\n<p>LOCATION – Make sure that the booth is going to be visible and accessible to all of the guests. The LAB is a natural attention grabber and by putting your booth in a prominent location, you’re guaranteed to get optimum interaction from guests.</p>\n\n<p>NOTIFICATION – Spread the word that The LAB will be in the building! Include information on invitations, use signage or good ‘ol word of mouth to direct your guests to snap a few pictures in the booth.</p>\n\n<p>PERSONALIZATION – It’s your party, you should have what you want to! Your booth should be a representation of you at all times. Choose props, background and other decorations that reflects the energy of your event and gets guests amped up to hop in and start snapping.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:35:27', '2016-09-12 06:35:27', '9f16b9e7-2f3f-40ca-84b3-1c78aec6a731'),
 ('28', '32', 'en_us', 'How long is setup time for The LAB ? Who sets it up? ', '<p>Setups take approx. one (1) hour and all setting up of The LAB is done by a LAB assistant.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:37:04', '2016-09-12 06:37:04', '450c4aa5-b499-4df8-9f28-529b006b91bd'),
 ('29', '33', 'en_us', 'What is a LAB assistant?', '<p>A LAB assistant is one of our designated representatives responsible for assembling and disassembling The LAB equipment and helping out with pictures during your event. Feel free to ask them for assistance during photo sessions and any other questions you have. That’s what they’re here for!<br /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:39:25', '2016-09-12 06:39:25', '270a0c45-1354-4a25-92ca-561f43640b64'),
 ('30', '34', 'en_us', 'How long can we book The LAB?', '<p>The LAB\'s minimum hire time is 2 hours, great for events with less than 120 party people. Should you have more guests, we suggest adding an additional hour per every 60 guests.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:40:13', '2016-09-12 06:40:13', '98f7aecb-3ef5-444c-aeac-e76ffda5984f'),
 ('31', '35', 'en_us', 'Do you have professional liability insurance? ', '<p>Absolutely. Don’t worry, we’re covered!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:40:37', '2016-09-12 06:40:37', '7dbff336-8844-4e5d-b46d-985bf062c442'),
 ('32', '36', 'en_us', 'Where can we see sample backdrop, props and photo card designs? ', '<p>We knew you’d ask that! We’ve got galleries of pictures for the most common occasions for you to see. Visit our gallery page here.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:41:02', '2016-09-12 06:41:02', 'bf6ef26b-d66a-462f-8f28-395e166c0a1d'),
 ('33', '37', 'en_us', 'What quality are The LAB prints and how long do they take to print? ', '<p>We use professional dye-sublimation printers that produce smudge-free prints in about 10 seconds on thick, robust paper. These will live for a long, long time on a fridge, cork board or in your scrapbook album.<br /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:42:00', '2016-09-12 06:42:00', '10e0eb0d-5310-41d8-911f-3fcc25a0607e'),
 ('34', '38', 'en_us', 'What space or logistical considerations are required? Do I need to provide anything?', '<p>All The LAB needs for setup is an area that’s 10 feet wide, 10 feet deep and 10 feet tall to ensure we have tons of room for a prop tables and all the guests ready to get some camera time. In addition, we request an unobstructed power source within 25′ of The LAB booth, and a good Wi-Fi connection for uploading pics to social media. You don\'t have to do anything!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:47:25', '2016-09-12 06:47:25', 'ba0f685c-d686-4a68-8bce-185a85aa5281'),
 ('35', '39', 'en_us', 'What is the payment schedule and refund policy?', '<p>Bookings are first come, first served and require a signed contract and deposit to reserve your date.\n\n  </p>\n\n<p>If the client wishes to cancel the booking sixty days before the event date, then the client is eligible for a full refund. An e-mail notification must be sent to saycheese@eventsbythelab.com sixty days before the event. The full amount paid will be credited back onto the client’s account where he/she paid the deposit.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:48:28', '2016-09-12 06:48:28', '018f3ca2-704e-49df-bf29-ca278a37daf0'),
 ('36', '40', 'en_us', 'What type of events can The LAB be at? ', '<p>You name it and The LAB is there! </p><p>We’ll bring The LAB to pretty much every party, as long as we’re all on the up-and-up and everything is legal. Corporate events, parties, proms, quinceaneras, bridal/baby shower, bar &amp; bat mitzvahs, charity events -- we got this. You got something else up your sleeve? Shoot us a message.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-09-12 06:49:03', '2016-09-12 06:49:03', '60f1d7f6-a01f-4fe5-99a7-25c4b3e00605'),
