 ('1', '2', '1', '1', 'en_us', '1', NULL, '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2016-06-12 21:58:16', '2016-06-12 21:58:16', '4689ee31-6bee-4e67-8b2b-be2ac702039e'),
 ('2', '2', '1', '1', 'en_us', '2', NULL, '{\"typeId\":null,\"authorId\":null,\"title\":\"Welcome to Localhost!\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":\"1\",\"parentId\":null,\"fields\":{\"1\":\"<p>It\\u2019s true, this site doesn\\u2019t have a whole lot of content yet, but don\\u2019t worry. Our web developers have just installed the CMS, and they\\u2019re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.<\\/p>\"}}', '2016-06-12 21:58:16', '2016-06-12 21:58:16', 'f579003a-b3b8-4041-a2a9-b5b6f1092f9e'),
 ('3', '3', '2', '1', 'en_us', '1', NULL, '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1465768696,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2016-06-12 21:58:16', '2016-06-12 21:58:16', '7442c643-67c6-4e4d-b93f-2b46c7d5495d'),
 ('4', '4', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Open-air Design\",\"slug\":\"open-air-design\",\"postDate\":1465876241,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The LAB has an elegant, modern open-air design making it easy to set up in any type of venue. There are no constraints and no extra clutter. Whether you\\u2019re a posing solo or with a group, there is ample space for up to 20 guests to get an effortlessly perfect shot<\\/p>\"}}', '2016-06-14 03:50:41', '2016-06-14 03:50:41', '47534d46-d0b0-4153-bd20-a5aaa43e64ed'),
 ('5', '5', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Studio Quality Camera\",\"slug\":\"studio-quality-camera\",\"postDate\":1465876268,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>It wouldn\\u2019t be fair to get dolled up just to get a bad picture in return. The LAB is equipped with innovative photographic technology and professional lighting that ensure highest quality images every time.<\\/p>\"}}', '2016-06-14 03:51:08', '2016-06-14 03:51:08', 'b7690b16-c881-43f9-b464-fb059bcfff04'),
 ('6', '6', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Snap & Share\",\"slug\":\"snap-share\",\"postDate\":1465876310,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>We know once you get that killer shot, you\\u2019re going to want everyone to see it. Share and send your picture directly to your social media pages or via email or text instantly with our convenient and super easy touchscreen technology.&nbsp;<\\/p>\"}}', '2016-06-14 03:51:50', '2016-06-14 03:51:50', '640cda36-4d47-4315-bba9-a7796a238494'),
 ('7', '7', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"The Perfect Keepsake\",\"slug\":\"the-perfect-keepsake\",\"postDate\":1465876328,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Every photo is customizable to commemorate the occasion. Choose from an assortment of photo sizes customized with frames, company logos, event graphics and more. The possibilities are endless to transform your pictures into an ultimate celebration souvenir.<\\/p>\"}}', '2016-06-14 03:52:08', '2016-06-14 03:52:08', '1c311b23-f104-451d-837d-e668abb8456f'),
 ('8', '8', '3', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"We\\u2019ve Got Your Back (drop)\",\"slug\":\"weve-got-your-back-drop\",\"postDate\":1465876513,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"14\":\"\",\"1\":\"<p>The backdrop is the canvas on which the perfect pictures are created. Our assortment of backgrounds come in an array of different colors and patterns to complement the excitement of your celebration. Do you need a backdrop of a ship for a bon voyage party or other party themes? Custom backdrops are also available at an additional charge.<\\/p>\"}}', '2016-06-14 03:55:14', '2016-06-14 03:55:14', 'fc47d29a-075a-4154-b7d8-5811fb519b35'),
 ('9', '9', '3', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"The LAB PropShop\",\"slug\":\"the-lab-propshop\",\"postDate\":1465876534,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"14\":\"\",\"1\":\"<p>It\\u2019s important that every picture is one of a kind and 100% YOU. The LAB\\u2019s PropShop is fully loaded with tons of different accessories, masks and other knick-knacks necessary to make each picture anything but ordinary. Having an 80\\u2019s party and need a rockin\\u2019 mullet wig? We can cater the PropShop to match any party theme at an additional charge.<\\/p>\"}}', '2016-06-14 03:55:34', '2016-06-14 03:55:34', 'b8fc4e59-43b6-4952-a698-962d63e50723'),
 ('10', '10', '5', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"SOCIAL booth\",\"slug\":\"social-booth\",\"postDate\":1465876640,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>No time for prints? The social both allows you to instantly send your picture to yourself via text\\/email or share with your friends posting your picture directly to your social media page right from the booth!&nbsp;<\\/p>\\r\\n\\r\\n<ul><li>2 hours of LAB time<\\/li><li>1 LAB assistant<\\/li><li>Personalized photo design<\\/li><li>Online Facebook gallery<\\/li><li>Social media integration&nbsp;<\\/li><\\/ul><p>$550<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\"}}', '2016-06-14 03:57:21', '2016-06-14 03:57:21', 'ad284abb-8814-4136-9206-c1196d7fcbc9'),
 ('11', '11', '5', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"CLASSIC booth\",\"slug\":\"classic-booth\",\"postDate\":1465876706,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Two full hours with the booth, a beautiful backdrop and a LAB assistant to help you though. Your guests are sure to be entertained and they will be leaving with a personalized keepsake from your event.<\\/p><ul><li>2 hours of LAB time<\\/li><li>1 LAB assistant<\\/li><li>Standard backdrop<\\/li><li>Personalized photo design<\\/li><li>Unlimited 1 print per setting<\\/li><\\/ul><p>$700<br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\"}}', '2016-06-14 03:58:26', '2016-06-14 03:58:26', '18359c96-7088-429f-b324-34e7fbe73ee8'),
 ('12', '12', '5', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"ESSETNTIAL booth\",\"slug\":\"essetntial-booth\",\"postDate\":1465876793,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>This has been the option for many happy clients \\u2013 in addition to your backdrop selection, additional print per sitting, your guest will enjoy digging into the PropShop to truly customize their shot. For three hours The LAB is yours to capture all your event memories!<\\/p>\\r\\n\\r\\n<ul><li>3 hours of LAB time<\\/li><li>2 LAB assistant<\\/li><li>Standard backdrop&nbsp;<\\/li><li>Standard PropShop<\\/li><li>Personalized photo design<\\/li><li>Unlimited 2 prints per setting<\\/li><li>Online Facebook gallery<\\/li><li>Social media integration<\\/li><\\/ul>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>$900<br><\\/p>\"}}', '2016-06-14 03:59:53', '2016-06-14 03:59:53', 'e61f2b4a-6a8b-4753-bca7-36599b580e02'),
 ('13', '13', '5', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"BOSS booth\",\"slug\":\"boss-booth\",\"postDate\":1465876857,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Keep your guest coming back for more with four full hours with The LAB, two LAB assistants, a premium backdrop and custom props from the PropShop. &nbsp;Plus, your guest will have the option to print the keepsake and use the social kiosk to share a copy friends on their Facebook or Twitter page.&nbsp;<br><\\/p><ul><li>4 hours of LAB time&nbsp;<\\/li><li>2 LAB assistants&nbsp;<\\/li><li>Premium backdrop &nbsp;<\\/li><li>Custom PropShop<\\/li><li>Personalized photo design&nbsp;<\\/li><li>Unlimited&nbsp;<\\/li><li>Online Facebook gallery&nbsp;<\\/li><li>Social media integration&nbsp;<\\/li><li>Social media kiosk&nbsp;<\\/li><\\/ul><p>$1350<\\/p>\"}}', '2016-06-14 04:00:57', '2016-06-14 04:00:57', '54bdd9e7-a311-4982-af44-bce8d475e313'),
 ('14', '14', '5', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"HEADSHOTS\",\"slug\":\"headshots\",\"postDate\":1465876891,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Are your employees using selfies and Instagram-filtered pictures for their professional headshots? The LAB is now available for headshots. You\\u2019ll get six headshots each for up to 35 employees \\u2013 with additional employees for $25 a person. We provide you with a white backdrop, a LAB assistant, and digital copies of every image. You provide the professionalism \\u2013 or goofiness! After all it\\u2019s your headshot<\\/p><p>$800<\\/p>\"}}', '2016-06-14 04:01:31', '2016-06-14 04:01:31', '224b9bab-7bc2-42bf-a955-8c4c168451b7'),
 ('15', '2', '1', '1', 'en_us', '3', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":\"\",\"6\":\"<p>The LAB is a Dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events. Our luxurious open-air photo booth is sure to make a statement and make memories that you\\u2019ll never forget.<\\/p>\\r\\n\\r\\n<p>So, what\\u2019s your occasion? A birthday? A wedding? A corporate shindig? You name it and The LAB photo booth will take the fun and entertainment up a notch.&nbsp;<\\/p>\",\"5\":\"Welcome to The LAB\",\"3\":\"\",\"4\":\"\",\"22\":\"\",\"17\":\"<p>There are tons of different party and event ideas that The LAB can add hours of fun and excitement to. From personal to corporate level, The LAB has options to fit your needs.<\\/p>\",\"16\":\"\",\"18\":[\"4\",\"5\",\"6\",\"7\"],\"11\":\"\",\"10\":\"<p>Come on in The LAB<\\/p><p>Inside The LAB is where all the magic happens and pictures truly come alive. Our collection of backdrops and props lets your guests make their photo op as classic or quirky as they\\u2019d like. Let\\u2019s get started!<\\/p>\",\"15\":[\"8\",\"9\"],\"9\":\"<p>What sets The LAB apart is our ability to seamlessly become part of the party and provide a fun, yet stylish experience. You get a professional quality camera and lighting equipment that promises to never take a bad picture and totally WOW your guests. The LAB provides:<\\/p>\",\"8\":\"A Close up of the LAB\",\"21\":\"\",\"19\":\"\",\"20\":\"The LAB Experience Packages\"}}', '2016-06-14 04:04:55', '2016-06-14 04:04:55', 'b973e49e-986a-4729-b0eb-37ca49135157'),
 ('16', '2', '1', '1', 'en_us', '4', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":\"\",\"6\":\"<p>The LAB is a Dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events. Our luxurious open-air photo booth is sure to make a statement and make memories that you\\u2019ll never forget.<\\/p>\\r\\n\\r\\n<p>So, what\\u2019s your occasion? A birthday? A wedding? A corporate shindig? You name it and The LAB photo booth will take the fun and entertainment up a notch.&nbsp;<\\/p>\",\"5\":\"Welcome to The LAB\",\"3\":\"\",\"4\":\"\",\"22\":\"\",\"17\":\"\",\"16\":\"\",\"18\":[\"4\",\"5\",\"6\",\"7\"],\"11\":\"\",\"10\":\"<p>Come on in The LAB<\\/p>\\r\\n\\r\\n<p>Inside The LAB is where all the magic happens and pictures truly come alive. Our collection of backdrops and props lets your guests make their photo op as classic or quirky as they\\u2019d like. Let\\u2019s get started!<\\/p>\",\"15\":[\"8\",\"9\"],\"9\":\"<p>What sets The LAB apart is our ability to seamlessly become part of the party and provide a fun, yet stylish experience. You get a professional quality camera and lighting equipment that promises to never take a bad picture and totally WOW your guests. The LAB provides:<\\/p>\",\"8\":\"A Close up of the LAB\",\"21\":\"<p>There are tons of different party and event ideas that The LAB can add hours of fun and excitement to. From personal to corporate level, The LAB has options to fit your needs.<\\/p>\",\"19\":[\"10\",\"11\",\"12\",\"13\",\"14\"],\"20\":\"The LAB Experience Packages\"}}', '2016-06-14 04:06:14', '2016-06-14 04:06:14', '988f48c3-3af1-4b52-b959-d92facfda867'),
