 ('29', '25', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"How does the booth actually work? \",\"slug\":\"how-does-the-booth-actually-work\",\"postDate\":1472845495,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>It\\u2019s so simple it\\u2019s almost crazy. People approach the booth, whether having grabbed a prop or not, and can see themselves in a live view screen right in the booth.<\\/p>\\r\\n\\r\\n<p>There is a touchscreen prompt that says to press the bolt with a notice that it will take three pictures. Once pressed, it initiates a 3-image session at 5 second intervals.<\\/p>\\r\\n\\r\\n<p>Once the 3 images are complete guests are asked to leave the booth to pick up their prints and\\/or share via the social kiosk.<\\/p>\\r\\n\\r\\n<p>We have an attendant there to help liaise peeps to the process, but they\\u2019re rarely needed after a few folks see how simply it works.<\\/p>\"}}', '2016-09-02 19:44:56', '2016-09-02 19:44:56', '100b2596-53b7-47aa-aabe-326b73690c1b'),
