 ('41', '11', '5', '1', 'en_us', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"The GROVE\",\"slug\":\"classic-booth\",\"postDate\":1465876680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Two full hours with the booth, a beautiful backdrop and a LAB assistant to help you though. Your guests are sure to be entertained and they will be leaving with a personalized keepsake from your event.<\\/p>\\r\\n\\r\\n<ul><li>2 hours of LAB time<\\/li><li>1 LAB assistant<\\/li><li>Standard backdrop<\\/li><li>Personalized photo design<\\/li><li>Unlimited 1 print per setting<\\/li><\\/ul>\\r\\n\\r\\n<p>$700<br><\\/p>\"}}', '2016-09-12 01:13:58', '2016-09-12 01:13:58', '2c750f46-8a41-48df-9450-483db9f8f1e3'),
 ('42', '10', '5', '1', 'en_us', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"The UPTOWN\",\"slug\":\"social-booth\",\"postDate\":1465876620,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>No time for prints? The social both allows you to instantly send your picture to yourself via text\\/email or share with your friends posting your picture directly to your social media page right from the booth!&nbsp;<\\/p>\\r\\n\\r\\n<ul><li>2 hours of LAB time<\\/li><li>1 LAB assistant<\\/li><li>Personalized photo design<\\/li><li>Online Facebook gallery<\\/li><li>Social media integration&nbsp;<\\/li><\\/ul>\\r\\n\\r\\n<p>$550<\\/p>\"}}', '2016-09-12 01:14:16', '2016-09-12 01:14:16', '42cdf56a-7776-49c6-9497-bfbc1aa8b320'),
 ('43', '9', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"We\'ve got your back(drop)\",\"slug\":\"the-lab-propshop\",\"postDate\":1465876500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"14\":[\"21\"],\"1\":\"<p>The backdrop is the canvas on which the perfect pictures are created. Our assortment of backgrounds come in an array of different colors and patterns to complement the excitement of your celebration. Do you need a backdrop of a ship for a bon voyage party or other party themes? Let us know what you would like and we\\u2019ll&nbsp;make it happen!<\\/p><p>Scroll to the left or right to view some of our favorites.&nbsp;<\\/p>\",\"31\":\"text-black\"}}', '2016-09-12 05:57:13', '2016-09-12 05:57:13', '86671da3-5fd2-40c9-87ed-e73de3a88d81'),
 ('44', '2', '1', '1', 'en_us', '13', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":[\"18\"],\"6\":\"<p>The LAB is a Dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events. Our luxurious open-air photo booth is sure to make a statement and make memories that you\\u2019ll never forget.<\\/p>\\r\\n\\r\\n<p>So, what\\u2019s your occasion? A birthday? A wedding? A corporate shindig? You name it and The LAB photo booth will take the fun and entertainment up a notch.&nbsp;<\\/p>\",\"5\":\"Welcome to The LAB\",\"34\":\"#000000\",\"33\":\"<p>Yes! We\'re&nbsp;excited that you want more info on The LAB. Please compete the information below and we\\u2019ll get touch soon to get the party started!<\\/p>\",\"32\":\"Contact\",\"22\":[\"20\"],\"17\":\"<p>It\\u2019s important that every picture is one of a kind and 100% YOU. The LAB\\u2019s PropShop is fully loaded with tons of different accessories, masks and other knick-knacks necessary to make each picture anything but ordinary. Having an 80\\u2019s party and need a rockin\\u2019 mullet wig? We can cater the PropShop to match any party theme.<\\/p>\",\"16\":\"The Lab Propshop\",\"18\":[\"4\",\"5\",\"6\",\"7\"],\"11\":[\"19\"],\"10\":\"<p>Inside The LAB is where all the magic happens and pictures truly come alive. Our collection of backdrops and props lets your guests make their photo op as classic or quirky as they\\u2019d like. Let\\u2019s get started!<br><\\/p>\",\"30\":\"Come on in The LAB\",\"15\":[\"8\",\"9\"],\"39\":\"#ffffff\",\"9\":\"<p>What sets The LAB apart is our ability to seamlessly become part of the party and provide a fun, yet stylish experience. You get a professional quality camera and lighting equipment that promises to never take a bad picture and totally WOW your guests. The LAB provides:<\\/p>\",\"8\":\"A Close up of the LAB\",\"35\":\"#bfbc31\",\"38\":[\"23\"],\"21\":\"<p>There are tons of different party and event ideas that The LAB can add hours of fun and excitement to. From personal to corporate level, The LAB has options to fit your needs.<\\/p>\",\"19\":[\"10\",\"11\",\"12\",\"13\",\"14\"],\"20\":\"The LAB Experience Packages\"}}', '2016-09-12 06:00:39', '2016-09-12 06:00:39', '9d3e0676-08b4-4bf6-9308-e79ed3e98a89'),
 ('45', '26', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"1\",\"title\":\"What does open-air mean? \",\"slug\":\"what-does-open-air-mean\",\"postDate\":1472845500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Open-air means that the days of cramming into a photo booth are over! \\r\\n\\r\\n  <\\/p>\\r\\n\\r\\n<p>There are no constraints and no extra clutter. The LAB gives you ample space to shine in a solo picture or pack in the fun with a group picture of 20 (or more) guests to get an effortlessly perfect shot.<\\/p>\"}}', '2016-09-12 06:28:46', '2016-09-12 06:28:46', '735ceb49-7a55-4cbf-af7a-0928eb2f3b2a'),
 ('46', '25', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"1\",\"title\":\"How does the booth actually work? \",\"slug\":\"how-does-the-booth-actually-work\",\"postDate\":1472845440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>We\\u2019re so glad you asked! When you\\u2019re ready to take a pic, just step up to the booth to get started. \\r\\n\\r\\n  <\\/p>\\r\\n\\r\\n<p>Feel free to sort through our plethora of props and let the good times roll. You\\u2019ll be able to see yourself live on our screen and it\\u2019s as easy as pose, snap, repeat.<\\/p>\\r\\n\\r\\n<p>&nbsp;After you\\u2019re done, pick up your printed keepsake and share on social media.<\\/p>\\r\\n\\r\\n<p>&nbsp;That\\u2019s it! Pretty simple. Remember, there will be a LAB assistant available to help you every snap of the way!<\\/p>\"}}', '2016-09-12 06:30:14', '2016-09-12 06:30:14', 'd637d570-944f-4943-b712-4819137de03b'),
 ('47', '31', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"How do I make sure The LAB is a hit with my guest? \",\"slug\":\"how-do-i-make-sure-the-lab-is-a-hit-with-my-guest\",\"postDate\":1473662127,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Three words.\\r\\n\\r\\n  <\\/p>\\r\\n\\r\\n<p>LOCATION \\u2013 Make sure that the booth is going to be visible and accessible to all of the guests. The LAB is a natural attention grabber and by putting your booth in a prominent location, you\\u2019re guaranteed to get optimum interaction from guests.<\\/p>\\r\\n\\r\\n<p>NOTIFICATION \\u2013 Spread the word that The LAB will be in the building! Include information on invitations, use signage or good \\u2018ol word of mouth to direct your guests to snap a few pictures in the booth.<\\/p>\\r\\n\\r\\n<p>PERSONALIZATION \\u2013 It\\u2019s your party, you should have what you want to! Your booth should be a representation of you at all times. Choose props, background and other decorations that reflects the energy of your event and gets guests amped up to hop in and start snapping.<\\/p>\"}}', '2016-09-12 06:35:27', '2016-09-12 06:35:27', '08f98a30-185d-4db5-8f94-596552b6698e'),
 ('48', '32', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"How long is setup time for The LAB ? Who sets it up? \",\"slug\":\"how-long-is-setup-time-for-the-lab-who-sets-it-up\",\"postDate\":1473662224,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Setups take approx. one (1) hour and all setting up of The LAB is done by a LAB assistant.<span><\\/span><\\/p>\"}}', '2016-09-12 06:37:04', '2016-09-12 06:37:04', 'e19bc5d6-2b23-45e2-9d3a-8d781f43eb53'),
 ('49', '33', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What is a LAB assistant?\",\"slug\":\"what-is-a-lab-assistant\",\"postDate\":1473662365,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>A LAB assistant is one of our designated representatives responsible for assembling and disassembling The LAB equipment and helping out with pictures during your event. Feel free to ask them for assistance during photo sessions and any other questions you have. That\\u2019s what they\\u2019re here for!<br><\\/p>\"}}', '2016-09-12 06:39:25', '2016-09-12 06:39:25', 'a4267119-ecf2-492e-992b-6057a952492f'),
 ('50', '34', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"How long can we book The LAB?\",\"slug\":\"how-long-can-we-book-the-lab\",\"postDate\":1473662413,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The LAB\'s minimum hire time is 2 hours, great for events with less than 120 party people. Should you have more guests, we suggest adding an additional hour per every 60 guests.<\\/p>\"}}', '2016-09-12 06:40:13', '2016-09-12 06:40:13', '10023153-6c6b-4b97-bf2a-f269c2f602e0'),
 ('51', '35', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Do you have professional liability insurance? \",\"slug\":\"do-you-have-professional-liability-insurance\",\"postDate\":1473662437,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Absolutely. Don\\u2019t worry, we\\u2019re covered!<\\/p>\"}}', '2016-09-12 06:40:37', '2016-09-12 06:40:37', '7bd20523-c666-460c-9f74-6455bd60a924'),
 ('52', '36', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Where can we see sample backdrop, props and photo card designs? \",\"slug\":\"where-can-we-see-sample-backdrop-props-and-photo-card-designs\",\"postDate\":1473662462,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>We knew you\\u2019d ask that! We\\u2019ve got galleries of pictures for the most common occasions for you to see. Visit our gallery page here.<\\/p>\"}}', '2016-09-12 06:41:02', '2016-09-12 06:41:02', 'b1170b70-5145-4b18-bd32-71199fcb3460'),
 ('53', '37', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What quality are The LAB prints and how long do they take to print? \",\"slug\":\"what-quality-are-the-lab-prints-and-how-long-do-they-take-to-print\",\"postDate\":1473662520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>We use professional dye-sublimation printers that produce smudge-free prints in about 10 seconds on thick, robust paper. These will live for a long, long time on a fridge,&nbsp;cork&nbsp;board&nbsp;or in your scrapbook album.<br><\\/p>\"}}', '2016-09-12 06:42:00', '2016-09-12 06:42:00', 'fc06e526-4a82-4676-a69f-e5b01951a203'),
 ('54', '38', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What space or logistical considerations are required? Do I need to provide anything?\",\"slug\":\"what-space-or-logistical-considerations-are-required-do-i-need-to-provide-anything\",\"postDate\":1473662845,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>All The LAB needs for setup is an area that\\u2019s 10 feet wide, 10 feet deep and 10 feet tall to ensure we have tons of room for a prop tables and all the guests ready to get some camera time. In addition, we request an unobstructed power source within 25\\u2032 of The LAB booth, and a good Wi-Fi connection for uploading pics to social media. You don\'t have to do anything!<\\/p>\"}}', '2016-09-12 06:47:25', '2016-09-12 06:47:25', 'ee7bcc80-e1bc-4a6b-8baf-7e27361b795a'),
 ('55', '39', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What is the payment schedule and refund policy?\",\"slug\":\"what-is-the-payment-schedule-and-refund-policy\",\"postDate\":1473662908,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Bookings are first come, first served and require a signed contract and deposit to&nbsp;reserve&nbsp;your date.\\r\\n\\r\\n  <\\/p>\\r\\n\\r\\n<p>If the client wishes to cancel the booking sixty days before the event date, then the client is eligible for a full refund. An e-mail notification must be sent to saycheese@eventsbythelab.com sixty days before the event. The full amount paid will be credited back onto the client\\u2019s account where he\\/she paid the deposit.<\\/p>\"}}', '2016-09-12 06:48:28', '2016-09-12 06:48:28', '1652b60b-d697-413b-af7d-69764bbdb6ee'),
 ('56', '40', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What type of events can The LAB be at? \",\"slug\":\"what-type-of-events-can-the-lab-be-at\",\"postDate\":1473662943,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>You name it and The LAB is there!&nbsp;<\\/p><p>We\\u2019ll bring The LAB to pretty much every party, as long as we\\u2019re all on the up-and-up and everything is legal. Corporate events, parties, proms, quinceaneras, bridal\\/baby shower, bar & bat mitzvahs, charity events -- we got this. You got something else up your sleeve? Shoot us a message.<\\/p>\"}}', '2016-09-12 06:49:03', '2016-09-12 06:49:03', '2196f9fb-4d68-4dde-9a5e-1e4b71336899'),
