 ('62', '2', '1', '1', 'en_us', '15', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1465768695,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"7\":[\"18\"],\"6\":\"<p>The LAB is a Dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events. Our luxurious open-air photo booth is sure to make a statement and make memories that you\\u2019ll never forget.<\\/p>\\r\\n\\r\\n<p>So, what\\u2019s your occasion? A birthday? A wedding? A corporate shindig? You name it and The LAB photo booth will take the fun and entertainment up a notch.&nbsp;<\\/p>\",\"5\":\"Welcome to The LAB\",\"34\":\"#000000\",\"33\":\"<p>Yes! We\'re&nbsp;excited that you want more info on The LAB. Please compete the information below and we\\u2019ll get touch soon to get the party started!<\\/p>\",\"32\":\"Contact\",\"22\":[\"20\"],\"17\":\"<p>It\\u2019s important that every picture is one of a kind and 100% YOU. The LAB\\u2019s PropShop is fully loaded with tons of different accessories, masks and other knick-knacks necessary to make each picture anything but ordinary. Having an 80\\u2019s party and need a rockin\\u2019 mullet wig? We can cater the PropShop to match any party theme.<\\/p>\",\"16\":\"The Lab Propshop\",\"18\":[\"4\",\"5\",\"6\",\"7\"],\"11\":[\"19\"],\"10\":\"<p>Inside The LAB is where all the magic happens and pictures truly come alive. Our collection of backdrops and props lets your guests make their photo op as classic or quirky as they\\u2019d like. Let\\u2019s get started!<br><\\/p>\",\"30\":\"Come on in The LAB\",\"15\":[\"9\",\"8\",\"50\"],\"39\":\"#ffffff\",\"9\":\"<p>What sets The LAB apart is our ability to seamlessly become part of the party and provide a fun, yet stylish experience. You get a professional quality camera and lighting equipment that promises to never take a bad picture and totally WOW your guests. The LAB provides:<\\/p>\",\"8\":\"A Close up of the LAB\