 ('14', 'field', '1', 'en_us', ' are your employees using selfies and instagram filtered pictures for their professional headshots the lab is now available for headshots you ll get six headshots each for up to 35 employees with additional employees for $25 a person we provide you with a white backdrop a lab assistant and digital copies of every image you provide the professionalism or goofiness after all it s your headshot$800 '),
