 ('2', 'field', '6', 'en_us', ' the lab is a dallas based party photo booth company on a mission to add a touch of sophisticated fun to your events our luxurious open air photo booth is sure to make a statement and make memories that you ll never forget so what s your occasion a birthday a wedding a corporate shindig you name it and the lab photo booth will take the fun and entertainment up a notch '),
