 ('24', 'title', '0', 'en_us', ' faq '),
 ('25', 'field', '1', 'en_us', ' we re so glad you asked when you re ready to take a pic just step up to the booth to get started feel free to sort through our plethora of props and let the good times roll you ll be able to see yourself live on our screen and it s as easy as pose snap repeat after you re done pick up your printed keepsake and share on social media that s it pretty simple remember there will be a lab assistant available to help you every snap of the way '),
 ('31', 'field', '1', 'en_us', ' three words location make sure that the booth is going to be visible and accessible to all of the guests the lab is a natural attention grabber and by putting your booth in a prominent location you re guaranteed to get optimum interaction from guests notification spread the word that the lab will be in the building include information on invitations use signage or good ol word of mouth to direct your guests to snap a few pictures in the booth personalization it s your party you should have what you want to your booth should be a representation of you at all times choose props background and other decorations that reflects the energy of your event and gets guests amped up to hop in and start snapping '),
 ('25', 'slug', '0', 'en_us', ' how does the booth actually work '),
 ('25', 'title', '0', 'en_us', ' how does the booth actually work '),
 ('26', 'field', '1', 'en_us', ' open air means that the days of cramming into a photo booth are over there are no constraints and no extra clutter the lab gives you ample space to shine in a solo picture or pack in the fun with a group picture of 20 or more guests to get an effortlessly perfect shot '),
 ('26', 'slug', '0', 'en_us', ' what does open air mean '),
