 ('24', 'field', '40', 'en_us', ' what does open air mean how does the booth actually work what type of events can the lab be at what is the payment schedule and refund policy what space or logistical considerations are required do i need to provide anything what quality are the lab prints and how long do they take to print where can we see sample backdrop props and photo card designs do you have professional liability insurance how long can we book the lab what is a lab assistant how long is setup time for the lab who sets it up how do i make sure the lab is a hit with my guest '),
