 ('33', 'field', '1', 'en_us', ' a lab assistant is one of our designated representatives responsible for assembling and disassembling the lab equipment and helping out with pictures during your event feel free to ask them for assistance during photo sessions and any other questions you have that s what they re here for '),
 ('33', 'slug', '0', 'en_us', ' what is a lab assistant '),
