 ('37', 'field', '1', 'en_us', ' we use professional dye sublimation printers that produce smudge free prints in about 10 seconds on thick robust paper these will live for a long long time on a fridge cork board or in your scrapbook album '),
 ('37', 'slug', '0', 'en_us', ' what quality are the lab prints and how long do they take to print '),
