 ('38', 'field', '1', 'en_us', ' all the lab needs for setup is an area that s 10 feet wide 10 feet deep and 10 feet tall to ensure we have tons of room for a prop tables and all the guests ready to get some camera time in addition we request an unobstructed power source within 25 of the lab booth and a good wi fi connection for uploading pics to social media you don t have to do anything '),
